import React, { useEffect } from "react";
import { useDispatch } from "react-redux";
import { retrieveCaughtPokemonAction } from "../actions/catchPokemonAction";
import { useSelector } from "react-redux";

function MyPokemon({ userId }) {
  const dispatch = useDispatch();
  const myCaughtPokemon = useSelector((state) => state.myCaughtPokemon);

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Wait for the dispatch to complete and get the data
        const caughtPokemon = await dispatch(retrieveCaughtPokemonAction(userId));
        // Dispatch an action to update the state with the fetched data
        dispatch({ type: "UPDATE_CAUGHT_POKEMON", payload: caughtPokemon });
      } catch (error) {
        console.error("Error retrieving caught Pokemon", error);
        console.log("myCaughtPokemon", myCaughtPokemon);
      }
    };

    fetchData();
  }, [dispatch, userId]);


  if (!myCaughtPokemon) {
    // You can show a loading spinner or message here while data is being fetched
    return <div>Loading...</div>;
  }

  return <div>MyPokemon</div>;
}

export default MyPokemon;
